import React from 'react';

class City extends React.Component {
  render() { 
    return (
        <div>
          <button>
            Show menu
          </button>

          <div className="menu">
            <button> Menu item 1 </button>
            <button> Menu item 2 </button>
            <button> Menu item 3 </button>
          </div>
        </div>
      );
    }
  }
export default City;
